import useFetch from "../../../hooks/useFetch";

const useCreateVideo = () => {
  const { data, error, fetchApi } = useFetch({
    path: "api/v1/videos",
    method: "POST"
  });


  return { data, error, fetchCreateVideo: fetchApi };
};

export default useCreateVideo;
